import React from 'react';
import '../css/header';

const AdminUserHeader = () => {
    const search = () => {
        // Implement your search logic here
    };

    const addUserBtn = () => {
        // Implement your add User button logic here
    };

    const accounts = () => {
        // Implement your accounts logic here
    };

    const logout = () => {
        // Implement your logout logic here
    };

    return (
        <header>
            <div className="background-guide-button">
                <svg className="guide-button" xmlns="http://www.w3.org/2000/svg">
                    <path d="M21 6H3V5h18v1zm0 5H3v1h18v-1zm0 6H3v1h18v-1z"></path>
                </svg>
            </div>
            <div className="background-logo-icon" title="Trang chủ Youtube">
                <svg className="logo-icon" xmlns="http://www.w3.org/2000/svg">
                    <g>
                        <path d="M27.9727 3.12324C27.6435 1.89323 26.6768 0.926623 25.4468 0.597366C23.2197 2.24288e-07 14.285 0 14.285 0C14.285 0 5.35042 2.24288e-07 3.12323 0.597366C1.89323 0.926623 0.926623 1.89323 0.597366 3.12324C2.24288e-07 5.35042 0 10 0 10C0 10 2.24288e-07 14.6496 0.597366 16.8768C0.926623 18.1068 1.89323 19.0734 3.12323 19.4026C5.35042 20 14.285 20 14.285 20C14.285 20 23.2197 20 25.4468 19.4026C26.6768 19.0734 27.6435 18.1068 27.9727 16.8768C28.5701 14.6496 28.5701 10 28.5701 10C28.5701 10 28.5677 5.35042 27.9727 3.12324Z" fill="#FF0000"></path>
                        <path d="M11.4253 14.2854L18.8477 10.0004L11.4253 5.71533V14.2854Z" fill="white"></path>
                    </g>
                </svg>
            </div>
            <div className="search-bar">
                <input type="text" id="search-bar" placeholder="Tìm kiếm" onInput={search} />
                <img src="/images/loupe.png" style={{ width: '20px', padding: '11px 20px 11px 20px' }} alt="Tìm kiếm" />
            </div>
            <div className="function">
                <a href="/login">
                    <div className="add-button" title="Tạo">
                        <img src="/images/plus.png" style={{ width: '30px', height: '30px' }} alt="Tạo" />
                    </div>
                </a>
                <div className="alert-button" title="Thông báo">
                    <img src="/images/bell.png" style={{ width: '30px', height: '30px' }} alt="Thông báo" />
                </div>
                <img src="/images/penguin.png" style={{ width: '50px', height: '50px' }} onClick={accounts} alt="Penguin" />
            </div>
            <div className="account" style={{ display: 'none' }}>
                <a href="/"><div className="admin">Quản lý video</div></a>
                <div className="logout" onClick={logout()}>Đăng xuất</div>
            </div>
        </header>
    );
};

export default AdminUserHeader;
